    volatile int *pixel_ctrl_ptr = (int *)0xff203020; // compile and run once - then change the last 2 to a 3 and recompile and run!!!!!!
    *pixel_ctrl_ptr = 1; // Start synchronization
    while ((*pixel_ctrl_ptr & 1) != 0); // Wait for S bit to clear
