//Pavel PS2 
char read_ps2_input() {
    volatile int *ps2_ptr = (int *)PS2_BASE;
    int data = *ps2_ptr;
    if (data & 0x8000) {
        char byte = data & 0xFF;
        if (byte == 0xF0) return 0; // Ignore break code
        if (byte == 0x1C) return 'a'; // A key
        if (byte == 0x23) return 'd'; // D key
        if (byte == 0x29) return ' '; // Spacebar
    }
    return 0;
}

