void draw_char(int x, int y, char c, short int colour, int scale) {
    if (c < 32 || c > 127) return; // Ignore non-printable characters

    for (int i = 0; i < 5; i++) {
        char line = font[c - 32][i];
        for (int j = 0; j < 7; j++) {
            if (line & (1 << j)) {
                // Scale up each pixel by `scale`
                for (int dx = 0; dx < scale; dx++) {
                    for (int dy = 0; dy < scale; dy++) {
                        plot_pixel(x + i * scale + dx, y + j * scale + dy, colour);
                    }
                }
            }
        }
    }
}

void draw_text(int x, int y, char *text, short int colour, int scale) {
    while (*text) {
        draw_char(x, y, *text, colour, scale);
        x += 6 * scale; //Space between characters increases with scale
        text++;
    }
}

