// TIMER + HEX---------------------------------------------------------

void HEX_DISP(int value, int display) {
    volatile int *hex_base;
    int bit_pattern;


    if (value & 0x10) {
        bit_pattern = 0;
    } else {
        value &= 0x0F; // Mask to 4 bits
        bit_pattern = BIT_CODES[value];
    }

    if (display < 4) {
        hex_base = HEX_BASE1;
    } else {
        hex_base = HEX_BASE2;
        display -= 4;
    }

    // Create a bit mask to isolate the target display
    int mask = ~(0xFF << (display * 8));
    int current_value = *hex_base;
    current_value = (current_value & mask) | (bit_pattern << (display * 8));

    // Write back to the display
    *hex_base = current_value;
}

void init_timer() {
    *timer_status = 0; //clear OT bit
    *timer_period_low = (COUNTER_DELAY & 0xFFFF);
    *timer_period_high = (COUNTER_DELAY >> 16);
    *timer_control = 0b0110; //***Enable continuous mode & start timer
}

void set_hex(high_score){
	if(time>=0){
		int tens = time / 10; // seperate each bit and display it in the needed hex
		int ones = time % 10; 	
		HEX_DISP(tens, 1);
		HEX_DISP(ones, 0);
        int scoretens = high_score / 10; 
		int scoreones = high_score % 10; 
        HEX_DISP(scoreones, 3);
		HEX_DISP(scoretens, 4);
	}
}

void TO_check() {
    if (*timer_status & 0x1) { //check for TO bit 
		*timer_status = 0; //Clear TO bit
		time --; 
	}
}


	
	

