void audio_playback_mono(int *samples, int n) {
            audiop->control = 0x8; // clear the output FIFOs
            audiop->control = 0x0; // resume input conversion
            for (int i  = 0; i < n; i++) {
              // wait till there is space in the output FIFO
              while (audiop->warc == 0);
              audiop->ldata = samples[i];
              audiop->rdata = samples[i];  
			  
             }
}

void audio_playback_mono_new(int  *samples, int n, int step, int replicate) {
            int i;
            audiop->control = 0x8; // clear the output FIFOs
            audiop->control = 0x0; // resume input conversion
            for (i = 0; i < n; i+=step) {
              //output data if there is space in the output FIFOs
              for (int r=0; r < replicate; r++) {
				while(audiop->warc == 0);
                audiop->ldata = samples[i];
                audiop->rdata = samples[i];
			  }
			}
	}	

bool audio_playback_mono_bool(int *samples_music, int n, int step, int replicate) {
    int i;
    int counter = 0;

    audiop->control = 0x8; // clear the output FIFOs
    audiop->control = 0x0; // resume input conversion
    
    for (i = 0; i < n; i += step) {
        for (int r = 0; r < replicate; r++) {
            if (counter < n) {
				while (audiop->warc == 0);
				audiop->ldata = samples_music[i];
				audiop->rdata = samples_music[i];
				counter++;
			}
        }
    }
    return true;
}

// C Program to Manually Convert an Integer to a String - code from geeks for geeks to convert a int to string
// using loops

void intToStr(int N, char *str) {
    int i = 0;
  
    // Save the copy of the number for sign
    int sign = N;

    // If the number is negative, make it positive
    if (N < 0)
        N = -N;

    // Extract digits from the number and add them to the
    // string
    while (N > 0) {
      
        // Convert integer digit to character and store
      	// it in the str
        str[i++] = N % 10 + '0';
      	N /= 10;
    } 

    // If the number was negative, add a minus sign to the
    // string
    if (sign < 0) {
        str[i++] = '-';
    }

    // Null-terminate the string
    str[i] = '\0';

    // Reverse the string to get the correct order
    for (int j = 0, k = i - 1; j < k; j++, k--) {
        char temp = str[j];
        str[j] = str[k];
        str[k] = temp;
    }
}

